import React from "react";
import { useDispatch } from "react-redux";
import "./HomeButton.css";

export default function HomeButton(props) {
  const { text } = props;

  const dispatch = useDispatch();

  return (
    <button
      onClick={() =>
        dispatch({
          type: "Home",
        })
      }
    >
      {text}
    </button>
  );
}
